import React, { Component } from 'react';
import { Map, GoogleApiWrapper } from 'google-maps-react';

const mapStyles = {
  width: '100%',
  height: '100%'
};

export class NewMap extends Component {
  render() {
    return (
      <Map
        google={this.props.google}
        zoom={12}
        style={mapStyles}
        initialCenter={
          {lat: 59.3293,
            lng: 18.0686
          }
        }
      />
    );
  }
}
export default GoogleApiWrapper(
    (props) => ({
      apiKey: props.apiKey
    }
  ))(NewMap)
